function BugLogTable(props) {
  const { bugLogs } = props;
  return (
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>Time</TableCell>
          <TableCell>Message</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {bugLogs.map((bugLog) => (
          <TableRow key={bugLog.id}>
            <TableCell>{bugLog.time}</TableCell>
            <TableCell>{bugLog.message}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  );
}

export default BugLogTable;
